import "./App.css";
import Data from "./components/Data";

function App() {
  const {genre} = Data;
  return (
    <div class="col-xs-6 table-responsive">
      <table class="table">
        {genre.map((value)=>{
          return (
            <>
            <tr>
          <td>{value}</td>
        </tr>
            </>
          )
        })}
      </table>
      <table class="table table-dark mt-80">
        <thead>
          <tr>
            <th scope="col">Title</th>
            <th scope="col">Genre</th>
            <th scope="col">Stock</th>
            <th scope="col">Rate</th>
            <th scope="col"> </th>
          </tr>
        </thead>

        <tbody>
          {Data.map((index) => {
            return (
              <>
                <tr>
                  <td>{index.title}</td>
                  <td>{index.genre}</td>
                  <td>{index.stock}</td>
                  <td>{index.rate}</td>
                  <td>
                    <button>Delete</button>
                  </td>
                </tr>
              </>
            );
          })}
          ;
        </tbody>
      </table>
    </div>
  );
}

export default App;
